import React from 'react';
import './App.css';
import Intro from './Container/Intro/Intro';
import Skill from './Container/Skills/Skill';
import Project from './Container/Projects/Project';
import Contact from './Container/Contact/Contact';
export default function App(){

function show(e){
    var a=e.clientY;
    if(a>200)
    {
        alert("hurray");
        console.log(a);
    }
}

    return(
        <>
        <div className="main" onMouseDown={show}>
        <Intro />
        <Skill />
        <Project />
        <Contact />
        </div>
        </>
    )
}
